import React from 'react'
import{ ritlogo} from '../images/ritlogo';

const Navbar = () => {
  return (
    <div className='h-15 z-1 bg-white'>
      <nav className="flex items-center justify-between flex-wrap px-4 py-3 w-full">
        <img src="" alt="" />
        <img src="" alt="" />
        <img src={ritlogo} alt="" />
            </nav>
    </div>
  )
}

export default Navbar
